INSERT INTO `articles` VALUES (1,2,'Вселенная может включать в себя огромное количество галактик, в которых совсем нет звезд. Они состоят только из темной материи. ','Темные галактики','Вселенная\r\nможет включать в себя огромное количество галактик, в которых совсем\r\nнет звезд. Они состоят только из темной материи. В конечном счете таких\r\nгалактик может оказаться гораздо больше, чем обычных галактик с\r\nсияющими звездами и газом, и соотношение между ними может составлять\r\n100 к 1. Это предсказание сделали астрономы Neil Trentham, Ole Moller и\r\nEnrico Ramirez-Ruiz из Кембриджского университета. Их статья будет\r\nопубликована в Monthly Notices Королевского Астрономического Общества.<br><br>Уже\r\nесть много доказательств того, что яркие галактики содержат большие\r\nколичества темной материи, масса которой часто в десять раз превышает\r\nмассу всех звезд галактики. Для того, чтобы объяснить наблюдаемые\r\nперемещения звезд под влиянием гравитации целой галактики, должна\r\nсуществовать дополнительная масса, которую мы не видим. В некоторых\r\nгалактиках, которые доступны наблюдениям, звезд явно недостаточно,\r\nчтобы они были способны составлять галактику и существовать как\r\nгалактика.<br><br>Теория предсказывает, что на одну массивную галактику\r\nприходится много галактик с низкой массой, которые мы не видим. Это\r\nпроисходит потому, что в них очень мало или совсем нет звезд. Таким\r\nобразом возникает вопрос: как искать эти темные галактики?<br><br>Это\r\nтрудная задача, и методика поиска будет зависеть от природы темной\r\nматерии, которая пока неизвестна. Если темная материя полностью состоит\r\nиз элементарных частиц, то темные галактики могут действовать как\r\nгравитационные линзы, деформируя вид удаленных галактик, лежащих позади\r\nних. Если темная галактика будет включать в себя коричневые карлики, то\r\nих инфракрасное излучение может быть обнаружено. Обнаружимы и\r\nпроэволюцианировавшие звезды, такие, как белые карлики или черные дыры.\r\nЕсли бы эти объекты находились на небольших расстояниях от нас, то\r\nможно было бы обнаружить эти потухшие звезды, играющие роль\r\nгравитационных линз для излучения отдельных звезд в других галактиках\r\nвне темной галактики. Несколько таких эффектов на малой площадке неба\r\nмогли бы означать присутствие в этом направлении темной галактики.<br><br>Исследователи\r\nопределили одно из таких мест, где может присутствовать темная\r\nгалактика. Галактика UGC 10214 ( фото смотрите в рубрике Галерея\r\nснимков ), из которой явно происходит отток вещества так, как если бы\r\nона взаимодействовала бы с другой галактикой. Но эта галактика невидна,\r\nи поток вещества течет как бы в никуда.','ok',10,1,1,'1.00','127.0.0.1;','2;','Karim',1109707692,0),(2,2,'Международная группа астрономов обнаружила самую массивную из всех известных галактик. Для наблюдений использовался инструмент ISAAC при знаменитом телескопе Very Large Telescope обсерватории Paranal (Paranal Observatory). Эта галактика, получившая наименование ISOHDFS 27, расположена на расстоянии около 6 миллиардов световых лет от нас.','Самая большая галактика','Международная\r\nгруппа астрономов обнаружила самую массивную из всех известных\r\nгалактик. Для наблюдений использовался инструмент ISAAC при знаменитом\r\nтелескопе Very Large Telescope обсерватории Paranal (Paranal\r\nObservatory).<br><br>Эта галактика, получившая наименование ISOHDFS 27,\r\nрасположена на расстоянии около 6 миллиардов световых лет от нас\r\n(величина красного смещения равна 0,58). Ее масса более чем в 1000\r\nмиллиардов раз больше массы Солнца. Таким образом, эта галактика\r\nпримерно в четыре раза массивнее нашей Галактики и вдвое - самой\r\nмассивной спиральной галактики из известных до сих пор.<br><br>Оптическое\r\nизображение далекой галактики ISOHDFS 27 получено космическим\r\nтелескопом Hubble. Угловой размер галактики составляет приблизительно 7\r\narcsec, что соответствует 130 000 световых лет (40 kpc) на расстоянии,\r\nравном 6 миллиардам световых лет. Наклон плоскости галактики к линии\r\nвизирования - около 50°<br><br>Определение массы галактики ISOHDFS 27\r\nосновано на измерении движений ее звезд и туманностей вокруг центра\r\nгалактики. Чем больше скорость движения, тем больше масса объекта. Это,\r\nв сущности, тот же самый метод, который позволяет определить массу\r\nЗемли, исходя из орбитальной скорости и расстояния до Луны.<br><br>Одна\r\nиз задач современной космологии заключается в том, чтобы понять, как\r\nэволюционируют звезды в галактиках и как формируются и развиваются сами\r\nгалактики. С появлением больших оптических и инфракрасных телескопов,\r\nтаких, как VLT ESO, астрономы получили возможность наблюдать\r\nчрезвычайно удаленные объекты и, следовательно, как бы заглянуть в\r\nпрошлое, в то время, когда в молодой Вселенной формировались галактики.\r\nВедь расстояние в 6 миллиардов световых лет означает, что мы видим\r\nгалактику такой, какой она была 6 миллиардов лет назад. Наблюдения в\r\nинфракрасной области спектра позволяют минимизировать эффекты\r\nпоглощения излучения пылевыми облаками.<br><br>Пока недостаточно хорошо\r\nизвестно, какие механизмы вызывают повышенную активность\r\nзвездообразования, но предполагается, что важную роль здесь могут\r\nиграть столкновения и слияния галактик. Звездообразование обычно\r\nпроисходит в глубине пылевых облаков, которые поглащают оптическое и\r\nультрафиолетовое излучение молодых звезд и переизлучают его в\r\nинфракрасной области спектра. Поэтому признаки процесса формирования\r\nзвезд лучше всего искать, проводя наблюдения в инфракрасной части\r\nспектра. С помощью детальных инфракрасных наблюдений далеких галактик\r\nмы сможем понять, как в далеком прошлом образовались основные\r\nструктуры, такие, например, как спиральные рукава и яркие звездные\r\nбалджи, которые наблюдаются в большинстве галактик.<br><br>В 1995-98\r\nгодах инфракрасная камера ISOCAM, установленная на борту инфракрасной\r\nкосмической обсерватории (Infrared Space Observatory) Европейского\r\nАстрономического Общества, впервые позволила астрономам взглянуть на\r\nВселенную в инфракрасном свете. Так была обнаружена новая категория\r\nобъектов - светлые далекие галактики с повышенным инфракрасным\r\nизлучением (галактики ISOHDFS). Некоторые из них и стали объектами\r\nисследования в 1999-2000 годах. Однако все эти галактики находятся на\r\nочень больших расстояниях от нас - несколько миллиардов световых лет\r\n(красные смещения от 0,6 до 1,5). К тому же это слабые объекты.<br><br>В\r\nсентябре 1999 года группа астрономов получила спектры около десятка\r\nэтих галактик. Были обнаружены спектральные линии атомов водорода\r\nН-alpha и определено, что излучение зарождается в запыленных областях с\r\nинтенсивным звездообразованием. Затем определили точные величины\r\nкрасных смещений (и следовательно - расстояний до отдельных галактик)\r\nпутем измерения Доплеровского смещения альфа-водородных линий в\r\nинфракрасных спектрах галактик. В августе 2000 года были проведены\r\nнаблюдения ISOHDFS галактик на VLT, в результате которых были измерены\r\nмассы центральных районов галактик.','ok',4,0,0,'0.00','','','cosmoportal.org.ua',1109707715,0),(3,3,'На 197-ой конференции Американского Астрономического Общества, прошедшей в январе 2001 г., группа американских астрономов представила результаты исследований планетарной туманности необычной сферической формы. ','Необычная планетарная туманность','На 197-ой конференции Американского Астрономического Общества, прошедшей в январе 2001 г., группа американских астрономов представила результаты исследований планетарной туманности необычной сферической формы. Многие планетарные туманности имеют форму бабочки. Рукава плотного газа в таких туманностях служат причиной того, что излучение звезд проходит через туманность неравномерно, в зависимости от плотности и толщины газовых рукавов, а также от расстояния между ними и звездами. Только в редких случаях геометрия туманности может быть выведена из косвенных измерений. В случае с туманностью Abell 39 исследователи обнаружили, что звезда, породившая эту туманность, имела только половину того количества кислорода, которым обладает Солнце. Этот результат не является чем-то особенно необычным, потому что Солнце имеет относительно богатый состав тяжелых элементов. Но для некоторых звезд те же самые методы исследований показали составы, которые расходятся друг с другом с коэффициентом в три или более раз. Наличие таких больших расхождений на данном этапе препятствует разработке детальной модели того, как создавались химические элементы в нашей Галактике и в других частях Вселенной. Обозначение Abell 39 означает 39-ый объект в каталоге больших туманностей, обнаруженных астрономом Джорджем Абеллом в 1966 году. Фотография туманности Abell 39 была получена с помощью 3.5-метрового телескопа обсерватории WIYN (Wisconsin-Indiana-Yale-NOAO) с использованием сине - зеленого фильтра, который исключает свет, испускаемый атомами кислорода туманности на длине волны 500.7 нанометров. Диаметр туманности составляет около 5 световых лет, толщина сферической оболочки - около одной третьей части светового года. Туманность расположена в созвездии Геркулес приблизительно в 7000 световых лет от Земли. Центральная звезда туманности на изображении находится немного правее центра. Это расстояние меньше одной десятой светового года. Причина такого смещения неизвестна.','ok',27,1,7,'7.00','127.0.0.1;','1;','Karim',1109707740,0),(6,6,'В статье поэтапно рассмотрены нюансы фотографирования объектов дальнего космоса от выбора объекта до выбора объектива.','Фотографирование','<p>&nbsp;&nbsp;Дип-скай объекты - самая интересная, но и одновременно самая трудная тема в астрофотографии. Интересна она потому, что ни в какой телескоп вы не увидите то, что покажет хорошо сделанная фотография. Ведь почти все объекты дальнего космоса имеют красивую цветовую окраску, которую просто невозможно заметить без применения фотографии. Трудная же она потому, что здесь требуется большой опыт в правильной подборке фотоплёнки, увеличения, экспозиции и т.д.\r\n </p><p>&nbsp;&nbsp;Если вы решили сделать фотографию объекта, то, естественно, надо сначала выбрать объект. Начинающим астрофотографам следует выбирать объекты поярче и покомпактнее (шаровые скопления, галактики, планетарные туманности). Одним словом, чем компактнее объект, тем больше концентрация фотонов, испускаемых им и тем меньше потребуется выдержка.\r\n </p><p>&nbsp;&nbsp;Итак, вы выбрали объект. Теперь нужно правильно подобрать фотоплёнку, чтобы она была достаточно чувствительна к тем областям видимого спектра, которые нас интересуют. Например, далеко не все плёнки подойдут для фотографирования туманности Северная Америка в Лебеде, так как это красное образование, а большинство продающихся плёнок не очень чувствительны к красной зоне спектра. Позднее мы опубликуем статью, где вы сможете узнать, какие плёнки для чего подходят.\r\n </p><p>&nbsp;&nbsp;После того, как вы выбрали марку плёнки, нужно определиться с выдержкой. С одной стороны, чем чувствительнее плёнку вы купите, тем больше шансов получить качественный снимок. С другой, у чувствительных плёнок зерно крупнее, то есть её разрешающая способность снижается. Поэтому приходится идти на комромисс. В люом случае следует применять фотоплёнки с чувствительностью от 400 и до 3200.\r\n </p><p>&nbsp;&nbsp;Что же касается объектива, то применять слишком большие фокусные расстояния нет смысла. Следует держаться в рамках от 600 до 2000 мм, хотя мне удалось разглядеть туманность М 57 на снимке, сделанном с помощью 50-миллиметрового объектива. Отностительное отверстие должно быть в пределах от 1:4 до 1:10.\r\n </p><p>&nbsp;&nbsp;Ну и последнее. Никакие статьи не дадут вам того, что дадут ваши собственные снимки. Набирайтесь опыта.\r\n </p>','ok',10,1,10,'10.00','127.0.0.1;','3;','Роман Чириков',1109882247,0),(8,2,'Космический рентгеновский телескоп XMM-Newton провел наблюдения центральной области галактики Андромеда (М31), обнаружив много новых точечных источников и признаки того, что в галактике присутствует очень горячий диффузный газ, который производит рентгеновское излучение.','Детальные изображения галактики Андромеды','Космический\r\nрентгеновский телескоп XMM-Newton провел наблюдения центральной области\r\nгалактики Андромеда (М31), обнаружив много новых точечных источников и\r\nпризнаки того, что в галактике присутствует очень горячий диффузный\r\nгаз, который производит рентгеновское излучение.<br><br>Галатика M31\r\nявляется идеальным объектам для наблюдений благодаря тому, что ее\r\nплоскость наклонена по отношению к нам, и вещество, находящееся в\r\nплоскости галактики, не затеняет источники излучения. Считается, что\r\nАндромеда во многих отношениях очень похожа на нашу собственную\r\nГалактику.<br><br>Наблюдения центральной области Андромеды, проведенные\r\nкосмическим телескопом, позволили обнаружить более сотни дискретных\r\nточечных источников. Среди них есть двойные рентгеновские системы. Одна\r\nиз них включает в себя нейтронную звезду. Другие, как считают\r\nисследователи, могут включать и черные дыры.<br><br>При обработке\r\nнаблюдений впервые были идентифицированы компоненты диффузной эмиссии,\r\nсодержащей кратные эмиссионные линии, что указывает на присутствие\r\nразличных химических элементов. Эти линии излучает чрезвычайно горячая\r\nплазма, разогретая до температуры более миллиона градусов. Вероятно,\r\nбольшая часть горячего газа была выброшена в пространство при взрывах\r\nсверхновых звезд. Измерив количество этого газа, можно сделать оценки\r\nотносительно того, как часто в галактие М31 происходят такие взрывы.','ok',1,0,0,'0.00','','','cosmoportal.org.ua',1109962346,202),(9,2,'Не потому ли далекие галактики выглядят необычно, что они и на самом деле необычные? Или они являются обычными нормальными галактиками, которые выглядят так потому, что наблюдатели видят их не полностью, а только самые яркие их части?','Галактики и эволюция Вселенной','Не\r\nпотому ли далекие галактики выглядят необычно, что они и на самом деле\r\nнеобычные? Или они являются обычными нормальными галактиками, которые\r\nвыглядят так потому, что наблюдатели видят их не полностью, а только\r\nсамые яркие их части? Для того, чтобы достигнуть Земли, излучение этих\r\nгалактик преодолевает огромные расстояния - миллиарды световых лет. Во\r\nвремя этого путешествия свет \"растягивается\" из-за расширения\r\nВселенной. В результате он сдвигается в инфракрасную область спектра, к\r\nкоторой современные приборы менее чувствительны. Непосредственно мы\r\nможем наблюдать излучение только тех областей, в которых есть молодые\r\nгорячие звезды, значительная часть энергии излучения которых приходится\r\nна ультрафиолетовую часть спектра.<br><br>Чтобы выяснить, как на самом\r\nделе выглядят далекие галактики, астрономы исследовали 37 близлежащих\r\nгалактик. Просматривая эти галактики в ультрафиолете, они сравнивали их\r\nформы с формами отдаленных галактик. Изображения ( смотрите их в\r\nрубрикеГалерея снимков ) были полученны космическим телескопом Hubble\r\nво время проведения обзора. Наблюдения галактик проводились в\r\nультрафиолетовом и видимом свете. Результаты обзора подтверждают\r\nпредположение о том, что астрономы способны видеть только \"вершину\r\nайсберга\" при наблюдении очень далеких галактик.<br><br>Центральная\r\nобласть спиральной галактики NGC 3310 включает в себя равномерно\r\nраспределенные молодые и старые звезды. Если бы такое распределение\r\nбыло характерно для большинства галактик, то далекие галактики можно\r\nбыло бы распознавать довольно легко. Однако в большинстве галактик\r\nзвезды распределяются в зависимости от возраста, что создает некоторые\r\nтрудности при классификации далеких галактик. Галактика NGC 3310\r\nнаходится в 46 миллионах световых лет от Земли в созвездии Ursa Major\r\n(Большая Медведица).<br><br>Второе изображение - маленькая молодая\r\nспиральная галактика ESO 418-008. Галактики, подобные этой, намного\r\nменьшие обычных, таких, как Млечный Путь. Звезды в них распределяются\r\nстрого в зависимости от их возраста. Старые звезды (красный цвет)\r\nнаходятся в центре; более молодые (синий цвет) - в спиральных рукавах.\r\nВозможно, эти малые молодые галактики представляют собой \"строительные\r\nблоки\" при формировании галактик. Галактика ESO 418-008 расположена в\r\n56 миллионах световых лет от Земли в южном созвездии Fornax (Печь).<br><br>Последнее\r\nизображение показывает столкновение двух галактик, UGC 06471 и UGC\r\n06472. В ранней Вселенной такие столкновения происходили часто, что\r\nприводило к появлению галактик необычных форм. Телескоп Hubble выявил\r\nмного таких галактик во время проведения обзоров неба. Ультрафиолетовые\r\nизображения слияния галактик показывают присутствие большого количества\r\nпыли, произведеной массивными звездами при формировании. Эта пыль\r\nокрашивает излучение звезд в красный цвет, точно так же как пыльная\r\nатмосфера Земли окрашивает в красный цвет область неба при заходе\r\nСолнца. Галактики UGC 06471 и UGC 06472 находятся на расстоянии 145\r\nмиллионов световых лет от Земли в созвездии Ursa Major (Большая\r\nМедведица).','ok',4,1,4,'4.00','127.0.0.1;','','cosmoportal.org.ua',1109963225,0),(10,2,'Пересеченная спиральная галактика NGC 2903 в созвездии Льва хорошо известна даже астрономам - любителям. Видимая звездная виличина этой галактики чуть больше 10, что позволяет легко найти ее в небе с помощью малого телескопа. Однако только большой телескоп может показать ее спиральную структуру.','Спиральная галактика NGC 2903','Пересеченная\r\nспиральная галактика NGC 2903 в созвездии Льва хорошо известна даже\r\nастрономам - любителям. Видимая звездная виличина этой галактики чуть\r\nбольше 10, что позволяет легко найти ее в небе с помощью малого\r\nтелескопа. Однако только большой телескоп может показать ее спиральную\r\nструктуру.<br><br>Эта галактика похожа на наш Млечный Путь, который\r\nтоже, как полагают, является пересеченной спиральной галактикой.\r\nПротяженные газо-пылевые области, которые на изображении выглядят\r\nтемными полосами, содержат большое количество молодых звезд (голубые\r\nкластеры) и видны на всем протяжении спиральных рукавов.<br><br>Спиральный\r\nводоворот увлекаемых галактикой звезд простирается на 80 000 световых\r\nлет - немного меньше, чем наша Галактика, - и удален от нас на\r\nрасстояние 25 миллионов световых лет. NGC 2903 - один из наиболее ярких\r\nобъектов северного неба, пропущенных Шарлем Мессье при составлении им в\r\n1784 году каталога туманностей и звездных скоплений. Открытие этого\r\nобъекта принадлежит Уильяму Гершелю.<br><br>На изображениях, полученных\r\nтелескопом, хорошо виден бар - полоса, пересекающая центр галактики и\r\nявляющаяся началом спиральных рукавов. Он выделяется своим немного\r\nкрасноватым цветом на фоне всей галактики. Причиной этого покраснения\r\nявляется большое количество пыли в центральной области. Бары в\r\nспиральных галактиках являются широко распространенным явлением. Две\r\nтрети всех спиральных галактик, известных на сегодняшний день, содержат\r\nтакие полосы. Уже давно предполагалось, что они способствуют активному\r\nзвездообразованию в галактиках.<br><br>Астрономы из Великобритании,\r\nАвстралии и Испании, используя превосходную систему обзора телескопа\r\nHubble в видимой и инфракрасной областях спектра, при исследовании\r\nцентральной области звездообразования галактики NGC 2903 обнаружили\r\nнеожиданное явление. Ядро галактики известно своей сложной структурой,\r\nвключающей много горячих точек. С помощью телескопа Hubble впервые\r\nудалось добиться такого разрешения, что эти горячие точки в центре\r\nстали видны как отдельные звезды и звездные кластеры, так что стало\r\nясно, что в этих горячих точках фактически не происходит процесс\r\nформирования звезд. Вместо этого звездообразование, по-видимому,\r\nпроисходит в близлежащих больших областях ионизованного водорода. Эти\r\nобласти распределены в пределах кольца шириной 2000 световых лет вокруг\r\nцентра галактики.<br><br>Подобные кольца были замечены и в других\r\nгалактиках. Часто они интерпретировались как область, из которой\r\nмежзвездный газ увлекается к центру галактики. Исследователи полагают,\r\nчто кольцо новорожденных звезд вокруг ядра NGC 2903 сформировалось\r\nблагодаря тому, что бар действует как транспортный механизм,\r\nнаправляющий газ к центру галактики, т.е. он является своеобразной\r\nворонкой для потока вещества из внешних областей дисков галактик к их\r\nцентрам.','ok',10,1,7,'7.00','127.0.0.1;','1;','cosmoportal.org.ua',1109963316,2899),(11,3,'Кроме звезд, в телескоп видны слабо светящиеся небольшие туманные пятна. Они получили название туманностей. Некоторые из них имеют довольно отчетливые очертания. В числе их наблюдаются немногочисленные так называемые планетарные туманности.','Туманности в небе','Кроме\r\nзвезд, в телескоп видны слабо светящиеся небольшие туманные пятна. Они\r\nполучили название туманностей. Некоторые из них имеют довольно\r\nотчетливые очертания. В числе их наблюдаются немногочисленные так\r\nназываемые планетарные туманности. Внутри каждой из них, в центре,\r\nвсегда есть одна очень горячая звезда. Такие туманности состоят из\r\nразреженного газа, который удаляется во все стороны от центральной\r\nзвезды со скоростью десятков километров в секунду. Если газовая\r\nоболочка вокруг звезды внутри полая, то туманность имеет вид кольца,\r\nкак, например, туманность в созвездии Лиры. Но многие туманности не\r\nимеют определенной формы. Они похожи на клочковатый туман,\r\nрастекающийся струями в разные стороны. Эти туманности называются\r\nдиффузными. Их известно несколько сот.<br><br>Наиболее замечательной из\r\nних является туманность в Орионе. Она видима даже в слабый телескоп, а\r\nиногда и невооруженным глазом. В этой огромной диффузной туманности,\r\nкак и в планетарных туманностях, светятся разреженные газы под\r\nдействием света горячих звезд, находящихся внутри туманности. Иногда\r\nяркая звезда освещает встретившееся с ней облако пылинок, по размерам\r\nсравнимых с частицами дыма. Тогда в телескоп мы видим тоже светлую\r\nдиффузную туманность, но уже не газовую, а пылевую. Множество\r\nтуманностей в XIX в. открыли Вильям Гершель и его сын Джон, работавший,\r\nв частности, в Южной Африке, чтобы наблюдать там южное небо.<br><br>В\r\nXX столетии много газовых туманностей открыл и изучал в Крыму\r\nроссийский ученый Г. А. Шайн. В большинстве случаев пылевые туманности\r\nне светятся, так как поблизости обычно не бывает звезд, способных их\r\nярко осветить. Эти темные пылевые туманности, нередко с отчетливо\r\nобрисованными краями, обнаруживаются, как прогалины, в светлых областях\r\nМлечного Пути. Такие туманности, как Конская голова (в Орионе, близ\r\nсветлой диффузной туманности), представляя собой скопления мельчайшей\r\nпыли, поглощают свет находящихся за ними звезд.','ok',4,1,5,'5.00','127.0.0.1;','','cosmoportal.org.ua',1109963623,0),(12,3,'Пространство между звездами не пустует. В очень малых концентрациях в нем присутствуют самые разнообразные частицы, в том числе и атомы многих веществ','Общие сведения о туманностях','Пространство\r\nмежду звездами не пустует. В очень малых концентрациях в нем\r\nприсутствуют самые разнообразные частицы, в том числе и атомы многих\r\nвеществ<br><br>В галактиках, вроде нашей собственной, наибольшее\r\nскопление межзвездного вещества достигается вблизи их плоскости, в\r\nспиральных рукавах, и Солнце как раз находится между двух таких\r\nрукавов. То, что вещество Галактики уплотнено возле одной плоскости, мы\r\nочень легко можем увидеть ясной ночью. Это уплотнение представляется\r\nнам в виде протянувшейся по всему небу туманной полосы - Млечного Пути.\r\nГлядя на него, мы смотрим вдоль плоскости Галактики<br><br>В\r\nнаправлении на Млечный Путь видно много звезд. Но кроме звезд здесь\r\nскапливается и межзвездное вещество. Плотность его в среднем такова,\r\nчто на один кубический сантиметр приходится всего одна частица. Однако,\r\nдесятки, сотни и тысячи световых лет, на протяжении которых распылены\r\nэти частицы, делают межзвездный газ ощутимым. Он поглощает и рассеивает\r\nсвет звезд, делая его краснее (так же, как на заре земная атмосфера\r\nделает краснее свет Солнца). Кроме того, вещество способно образовывать\r\nв тысячу раз более плотные газовые облака. Их-то мы и видим как\r\nтуманности<br><br>В межзвездной среде присутствует также и пыль, в еще\r\nменьших концентрациях примешивающаяся к газу. В состав пылинок входят\r\nжелезо, кремний, азот, кислород, углерод и другие элементы. Все они\r\nмогут образовывать простейшие молекулы (воду, углекислый газ). Иногда\r\nвстречаются и более сложные молекулы<br><br>Откуда берутся все эти\r\nвещества? Они \"поставляются\" в космос старыми звездами, которые,\r\nобразуя планетарные туманности, теряют свои внешние слои. Тяжелые\r\nэлементы (тяжелее гелия) выбрасываются в относительно больших\r\nколичествах взрывами сверхновых. Случайные уплотнения межзвездного\r\nвещества могут стать зачатками образования больших газопылевых облаков,\r\nкаждое из которых способно породить несколько десятков или даже сотен\r\nзвезд<br><br>Итак, мы видим в виде туманностей газопылевые облака.\r\nДальше мы поговорим именно об этих туманностях, исключив из\r\nрассмотрения планетарные туманности и остатки взрывов сверхновых<br><br>Астрономы\r\nделят туманности на излучающие (эмиссионные), отражающие и темные. У\r\nних у всех может быть один и тот же химический состав, но выглядят на\r\nнебе они по-разному. Почему?<br><br>Если газопылевое облако настолько\r\nразогрето ближайшими звездами, в том числе находящимися и родившимися в\r\nнем самом, то оно может начать светиться, как любой нагретый до высокой\r\nтемпературы газ. Это - излучающие туманности, их свет красноватый, ведь\r\nименно этому цвету соответствует излучение водорода, из которого по\r\nбольшей части состоят все туманности. Температура газа в излучающих\r\nтуманностях может доходить до миллионов градусов. Одна из излучающих\r\nтуманностей - Туманность Розетка<br><br>Если туманность не\r\nпрогревается, то ее температура может едва превышать 0 К. Однако\r\nотносительная близость звезд может и такую туманность сделать видимой.\r\nПылевые частицы отражают и рассеивают свет и мы видим голубоватое\r\nсвечение газопылевого холодного облака. Такие туманности называются\r\nотражающими. Примером таких объектов может быть М43.','ok',7,1,6,'6.00','127.0.0.1;','3;','cosmoportal.org.ua',1109963832,0),(5,5,'Основные моменты, связанные с наблюдением объектов дальнего космоса.','Наблюдения','<p>  Наблюдение объектов дальнего космоса - особенная страница в практической астрономии. Мало где ещё вы встретите столько тонкостей и особенностей техники наблюдения. Ниже кратко изложено множество аспектов наблюдений.\r\n </p><p>  Прежде всего, отметим, что большинство объектов из разряда дип-скай довольно тусклые. Поэтому, для получения максимально яркого изображения надо применять инструменты (чаще всего телескопы) с как можно большим диаметром объектива (входного зрачка, апертурой). Обычно для наблюдений таких объектов используются телескопы-рефлекторы (зеркальные), так как при одинаковых диаметрах объективов, рефлектор будет стоить гораздо дешевле рефрактора (линзового). Для эффективных наблюдений желательно применять телескопы с апертурой в 200 мм и больше.\r\n </p><p>  Очень важным моментом является яркость неба. Тусклые и протяжённые объекты очень трудно, а часто и невозможно, заметить на ярком небе. На яркость влияют два основных фактора: время года и уровень светового загрязнения (искусственной засветки неба). Если вы наблюдаете из умеренных или полярных широт северного полушария и на дворе конец июня то вряд ли вы сумеете понаблюдать трудные для наблюдения объекты (протяжённые туманности, большие галактики, такие как М101 и т.д.). Но примерно тот же результат вы получите и при наблюдении тёмной зимней ночью в большой телескоп из города. Запомните, небольшой телескоп в сельской местности вдали от городской засветки покажет вам больше, чем большой в городе.\r\n </p><p>  Также следует упомянуть и о спокойствии атмосферы. Ясное дело, что наблюдение в ветреную ночь ничего хорошего не принесёт. Восходящие потоки тёплого воздуха образуются и при остывании земной поверхности после жаркого дня, и чем жарче был день, тем дольше требуется времени, чтобы земля остыла. Летом она остывает к 4 - 5 часам утра. Но по большому счёту эти восходящие потоки не так уж важны при любительских наблюдениях. Но дрожание воздуха внутри и перед трубой телескопа сказываются заметнее, поэтому обязательно давайте телескопу остыть с полчаса перед наблюдением, если он хранится в помещении. Достаточно открыть крышку трубы и повернуть её вертикально отверстием вверх, чтобы тёплый воздух из неё мог свободно выходить.\r\n </p><p>  Что вы видите, когда выходите из светлой комнаты ночью на улицу или заходите после прогулки в солнечный день в тёмный подъезд? Правильно - ничего. Ваши глаза, привыкшие к яркому свету, не сразу могут привыкнуть к темноте, так как при ярком свете зрачки ваших глаз сужаются, причём довольно быстро, но вот расширяются они гораздо медленнее. Процесс привыкания к темноте называется адаптацией. Продолжается она не так быстро как кажется. Через 15 минут адаптации вы сумеете хорошо ориентироваться в темноте при работе с телескопом. Ещё через 15 минут вы сумеете увидеть гораздо больше звёзд на небе. Но для достижения наилучших результатов потребуется ещё 90 минут. Для освещения звездных карт, часов и прочего надо пользоваться только фонариком с красным светофильтром, а лучше сделать простенький фонарик на красном светодиоде с регулировкой яркости. Это делается для того, чтобы не дать зрачкам сузиться от света, так как наши глаза наименее чувствительны к красному свету.\r\n </p><p>  Используйте боковое зрение. Если ваш объект наблюдения слишком тусклый, и вы не видите его, глядя прямо на него, попробуйте посмотреть немного в сторону, концентрируя внимание на объекте. Вы увидите объект (если, конечно, он не слишком тусклый для вашего инструмента). Это происходит из-за того, что более чувствительные \"палочки\" расположены у краёв сетчатки глаза. Сначала это может не получаться, но со временем это не будет составлять для вас труда.\r\n </p><p>  Не разочаровывайтесь, если видите объект чёрно-белым, хотя на фотографии он пестрит яркими красками. Почти все дип-скай объекты слишком тусклые, чтобы раздражать цветочувствительные \"колбочки\" вашего глаза.\r\n </p><p>  И последнее. Если в книге вы прочитали, что такой-то объект можно заметить с помощью 150-мм телескопа, а вы не видите его даже в 200-мм - не расстраивайтесь. Книги написаны опытными астрономами, которые наблюдают не один десяток лет и у которых огромный опыт за плечами. Наблюдайте и наблюдайте! Поверьте, с каждым часом наблюдений ваш опыт растёт и вы будете даже удивляться своим достижениям!','ok',10,1,10,'10.00','127.0.0.1;','3;','Роман Чириков',1109878940,0);
