INSERT INTO `news` VALUES (1,1,'25 февраля 2005 года в Московском государственном областном университете в 11 часов начнется очередная астрономическая олимпиада школьников Московской области. К участию в олимпиаде приглашаются победители районного (городского) тура среди 9-11 классов и призеры Московской областной олимпиады 2004 года.\r\n\r\nВ этом году распоряжением министерства образования Московской области изменен порядок проведения олимпиады:\r\n\r\nК участию в олимпиаде будут допущены только школьники, указанные в заявке муниципального органа управления образованием, поданной заранее в 2-х экземплярах в министерство образования Московской области. К заявке необходимо приложить анкеты, заполненные на каждого из школьников и приказ муниципального органа управления образованием о направлении команды на олимпиаду. Каждый участник олимпиады должен иметь при себе медицинскую справку о состоянии здоровья, выданную школьным врачом.\r\n\r\nКоманду могут сопровождать только лица, указанные в заявке. Другие сопровождающие допускаться на территорию МГОУ не будут.\r\n\r\nАдрес МГОУ: Москва, ул. Радио, д.10а (м. Курская, выход к театру им. Гоголя) ','25 февраля 2005 года в Московском областном государственном университете в 11 часов начнется очередная астрономическая олимпиада школьников Московской области.','Московская областная астрономическая олимпиада',1,'ok',1109011192),(5,1,'Сайт DeepSky принял участие в конкурсе АстроТоп-100 2005 в номинации Любительская астрономия. Вы можете проголосовать за наш сайт по адресу <a href=http://www.astrotop.ru target=_blank>www.astrotop.ru</a>.','Сайт DeepSky принял участие в конкурсе АстроТоп-100 2005 в номинации Любительская астрономия.','Участие в конкурсе АстроТоп',3,'ok',1111532276),(2,1,'\r\nТак как китайский календарь основан на лунных месяцах, начало Нового года попадает на различные даты, но всегда в промежуток между 20 января и 20 февраля.\r\n\r\nВ 2005 году Китайский Новый Год наступает 9 февраля, точнее в этот день начинается первый день нового года по китайскому календарю. Наступающий год будет годом синего (зеленого) деревянного петуха. ','Так как китайский календарь основан на лунных месяцах, начало Нового года попадает на различные даты, но всегда в промежуток между 20 января и 20 февраля. В 2005 году Китайский Новый Год наступает 9 февраля, точнее в этот день начинается первый день нового года по китайскому календарю. Наступающий год будет годом синего (зеленого) деревянного петуха.','Китайский новый год 2005',1,'ok',1109011214),(3,1,'25 января 2005 года крупнейшему и известнейшему Университету России – Московскому Государственному Университету им. М.В.Ломоносова – исполняется 250 лет!\r\nМы крайне рады этому юбилею, желаем МГУ, нашей альма-матер, здравствовать и развиваться. ','25 января 2005 года крупнейшему и известнейшему Университету России – Московскому Государственному Университету им. М.В.Ломоносова – исполняется 250 лет!','МГУ – 250 лет',1,'ok',1109011270),(6,1,'Сайт DeepSky обрел новое лицо! Были переработаны концепции дизайна и интерфейса. \r\nТакже появились некоторые приятные дополнения. Коренным образом переделана фотогаллерея, а также обновился раздел Небо над головой. Теперь происходит отрисовка созвездий! Пользуйтесь и наслаждайтесь!!!','Сайт DeepSky обрел новое лицо! Также появились некоторые приятные дополнения.','Обновление сайта.',3,'ok',1111532576),(8,1,'В последнее время ежегодно открываются десятки и сотни Сверхновых звезд. Большинство из них расположено в очень далеких галактиках – в близких подобные события случаются гораздо реже (в Млечном Пути сверхновые не вспыхивали уже 300 лет). \r\n\r\nКак выглядит предсверхновая непосредственно перед вспышкой (за год или месяц)? Это мы могли бы сказать про близкую предсверхновую (близкую, следовательно, достаточно яркую) если бы знали куда смотреть. Есть несколько случаев, когда предсверхновую находили на фотографиях, сделанных незадолго до вспышки. Например, таким образом про знаменитую SN1987a установили, что это был голубой сверхгигант. Особо удачно, если фотография была сделана в нескольких фильтрах, это позволяет установить цвет и, как следствие, спектральный класс звезды. Но про предсверхновую, которая находится в крайне необычном состоянии, обычные спектральные классы мало что говорят. \r\n\r\nГораздо лучше было бы иметь спектр предсверхновой. И вот это случилось. Спектр предсверхновой SN2004dj в близкой галактике NGC2403 был \"случайно\" измерен Российскими астрономами. Слово \"случайно\" взято в кавычки со смыслом – измерялись спектры сильно проэволюционировавших звезд, т.е. возможных кандидатов в предсверхновые. Хотя никто и не ожидал, что одна из них взорвется через год. Но везет тем, кто к этому долго и тщательно готовится.','первые в руках астрономов оказался высококачественный спектр предсверхновой SN2004dj, которая взорвалась в близкой галактике NGC2403.','Открытие или везение?',3,'ok',1118257377);
