INSERT INTO `tips` VALUES (5,'При наблюдении слабых объектов может помочь большое увеличение, так как разрешающая способность глаза резко уменьшается в темноте.'),(3,'Существует предел выдержки при фотографировании звёздных полей, после которого перестанут фиксироваться новые звёзды, а лишь будет засвечиваться фон.'),(4,'Самая чувствительная область бокового зрения - 8-16 градусов от центра к носу и 6-12 градусов к верху.'),(6,'Оптимальный выбор для съёмки красных газовых туманностёй - Kodak Supra 400 или Agfa Optima II 400.');
